(1, 1, 'Info Static footer', '<section class="footer_block col-xs-12 col-sm-12 col-md-3 col-lg-3 col-xl-3">\r\n<div class="pos-title">\r\n<h2><span class="title">Extra</span></h2>\r\n</div>\r\n<ul class="toggle-footer footer_list">\r\n<li class="item"><a title="Specials" href="#"> Brands </a></li>\r\n<li class="item"><a title="New products" href="#">Gift Vouchers</a></li>\r\n<li class="item"><a title="Best sellers" href="#">Affiliates</a></li>\r\n<li class="item"><a title="Our stores" href="#"> Our stores </a></li>\r\n<li class="item"><a title="Site Map" href="#"> Specials</a></li>\r\n</ul>\r\n</section>'),
(1, 2, 'Info Static footer', '<section class="footer_block col-xs-12 col-sm-12 col-md-3 col-lg-3 col-xl-3">\r\n<div class="pos-title">\r\n<h2><span class="title">Extra</span></h2>\r\n</div>\r\n<ul class="toggle-footer footer_list">\r\n<li class="item"><a title="Specials" href="#"> Brands </a></li>\r\n<li class="item"><a title="New products" href="#">Gift Vouchers</a></li>\r\n<li class="item"><a title="Best sellers" href="#">Affiliates</a></li>\r\n<li class="item"><a title="Our stores" href="#"> Our stores </a></li>\r\n<li class="item"><a title="Site Map" href="#"> Specials</a></li>\r\n</ul>\r\n</section>'),
(2, 1, 'Footer Static Top', '<div class="footer-static-2">\r\n<div class="row">\r\n<div class="col-lg-3 col-xl-3 col-md-6 col-sm-6 col-sms-6 col-smb-12">\r\n<div class="f-col f-col1">\r\n<div class="footer-title pos-title">\r\n<h2><span class="title">about us</span></h2>\r\n</div>\r\n<div class="footer-content"><a href="#"><img src="/posthemes/pos_classico_1.7/img/cms/logo.png" alt="" /></a>\r\n<div class="des">\r\n<p>The company was established in 2012 and specializes in the import and sale of high-quality dental products with accompanying support, familiarization and training of specialists.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="col-lg-3 col-xl-3 col-md-6 col-sm-6 col-sms-6 col-smb-12">\r\n<div class="f-col f-co2">\r\n<div class="footer-title pos-title">\r\n<h2><span class="title">Events</span></h2>\r\n</div>\r\n<div class="footer-content">\r\n<ul>\r\n<li>Trainings</li>\r\n<li>Webinars</li>\r\n<li>Seminars</li>\r\n<li>Other Events</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="col-lg-3 col-xl-3 col-md-6 col-sm-6 col-sms-6 col-smb-12">\r\n<div class="f-col f-col3">\r\n<div class="footer-title pos-title">\r\n<h2><span class="title">How to order</span></h2>\r\n</div>\r\n<div class="footer-content">\r\n<ul>\r\n<li><span class="key">1</span>Choose your wishlist products .</li>\r\n<li><span class="key">2</span>Call us for more info about our products.</li>\r\n<li><span class="key">4</span>We will send this product in 2 days.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="col-lg-3 col-xl-3 col-md-6 col-sm-6 col-sms-6 col-smb-12">\r\n<div class="f-col f-col4">\r\n<div class="footer-title pos-title">\r\n<h2><span class="title">contact us</span></h2>\r\n</div>\r\n<div class="footer-content">\r\n<div class="fax">\r\n<p>Call Us +(995) 597 92 64 69</p>\r\n</div>\r\n<div class="phone">\r\n<p></p>\r\n<p>+(995) 571 85 07 77</p>\r\n</div>\r\n<div class="email">\r\n<p>implantlinege@mail.ru</p>\r\n<div class="address">\r\n<p>3, Mamardashvili (Ardoni) Str.<br /> Tbilisi-0102, Georgia</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>'),
(2, 2, 'Footer Static Top', '<div class="footer-static-2">\r\n<div class="row">\r\n<div class="col-lg-3 col-xl-3 col-md-6 col-sm-6 col-sms-6 col-smb-12">\r\n<div class="f-col f-col1">\r\n<div class="footer-title pos-title">\r\n<h2><span class="title">about us</span></h2>\r\n</div>\r\n<div class="footer-content"><a href="#"><img src="/posthemes/pos_classico_1.7/img/cms/logo.png" alt="" /></a>\r\n<div class="des">\r\n<p>Lorem ipsum dolor sit amet, consectetur adipisicing elitse do eiusmod tempor incididunt ut labore et dolore.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="col-lg-3 col-xl-3 col-md-6 col-sm-6 col-sms-6 col-smb-12">\r\n<div class="f-col f-co2">\r\n<div class="footer-title pos-title">\r\n<h2><span class="title">THEME FEATURES</span></h2>\r\n</div>\r\n<div class="footer-content">\r\n<ul>\r\n<li>theme features</li>\r\n<li>Typography</li>\r\n<li>Our Other Projects</li>\r\n<li>One Click To Join Us</li>\r\n<li>Follow Us On Twitter</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="col-lg-3 col-xl-3 col-md-6 col-sm-6 col-sms-6 col-smb-12">\r\n<div class="f-col f-col3">\r\n<div class="footer-title pos-title">\r\n<h2><span class="title">KEY FEATURES</span></h2>\r\n</div>\r\n<div class="footer-content">\r\n<ul>\r\n<li><span class="key">1</span>Choose your wishlist products then add to cart.</li>\r\n<li><span class="key">2</span>Call us for more info about our products.</li>\r\n<li><span class="key">3</span>Pay by creadit card.</li>\r\n<li><span class="key">4</span>We will send this product in 2 days.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="col-lg-3 col-xl-3 col-md-6 col-sm-6 col-sms-6 col-smb-12">\r\n<div class="f-col f-col4">\r\n<div class="footer-title pos-title">\r\n<h2><span class="title">contact us</span></h2>\r\n</div>\r\n<div class="footer-content">\r\n<div class="fax">\r\n<p>Call Us +001 666 951</p>\r\n<p>Fax +001 678 987</p>\r\n</div>\r\n<div class="phone">\r\n<p>+77 123 1234</p>\r\n<p>+42 98 9876</p>\r\n</div>\r\n<div class="email">\r\n<p>info@example.com</p>\r\n<p>business@example.com</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>'),
