(21, 1, 1, '<p>Last, but not least: Flairesse Prophylaxis varnish seals dentin tubules reliably.</p>\r\n<p>It desensitizes and is therefore a true winner for hypersensitive teeth.</p>\r\n<p>Just like the other Flairesse system components, the varnish contains xylitol and fluoride. This provides peace of mind. Flairesse smiles look fantastic: The clear varnish is not visible on the teeth.</p>\r\n<p></p>\r\n<ul>\r\n<li>Desensitizes reliably</li>\r\n<li>Contains xylitol and fluoride (22,600 ppm)</li>\r\n<li>Invisible on teeth</li>\r\n<li>2 fresh flavors: Mint and Melon</li>\r\n<li> Easy to use</li>\r\n</ul>\r\n<p>More Info: <a href="https://www.dmg-dental.com/en/products/product/42496/" target="_blank">https://www.dmg-dental.com/en/products/product/42496/</a></p>', '<p>Flairesse Prophylaxis paste removes discolorations, and plaque and it polishes the tooth''s surface. The patient feels the results immediately.</p>\r\n<p>Three different grits – coarse, medium, fine – allow adjusting the degree of abrasion precisely.</p>\r\n<p>Very gentle: Flairesse does not cause any unnecessary abrasion of the tooths structure and restoration surfaces. The paste contains fluoride and is free of known allergens.</p>\r\n<p></p>', 'flairesse-varnish', '', '', '', 'Flairesse varnish', '', ''),
