(26, 5, 1, '<p>The most powerful air driven handpiece of the world<br /><br />Power is Control. The confidence to master any challenge. Every aspect of the Tornado makes a clear and convincing statement of its leadership position. Equipped with SteadyTorque™ technology, this competent air driven handpiece delivers an outstanding power output of 30 watts – a superiority that is both hard to compare and hard to resist. Experience faster dental procedures and expand your practice’s efficiency and profitability with commanding skill.<br /><br />Silence is Comfort. The satisfaction of quiet effectiveness. The lowest on the market today, the decibel intensity of the Tornado equals that of a peaceful Alpine stream, thanks to the noise-reducing properties of two novel features – the Accu-Spray Quattro Mix™ spray system and the Accu-Chuck PreciPlus™ vibration-canceling bur-retention mechanism. This soft, almost reassuring sound is intended to help even your most apprehensive patients feel at ease, all while protecting and preserving your hearing.<br /><br />Reliability is Performance. Our commitment to first-rate quality. The coming together of the most advanced micro-technologies and more than 50 years of industry expertise and innovation ensures quality and reliability without compromise. This is substantiated as Bien-Air products are designed, manufactured, and individually-tested at our global headquarters in Bienne, Switzerland. Think of the TORNADO as a cornerstone of your practice and a fundamental component of your reputation.<br /><br />* 2-year standard warranty and 1-year optional warranty available</p>\r\n<p>More info: <a href="https://dental.bienair.com/en/products/turbines/advanced/tornado.html" target="_blank">https://dental.bienair.com/en/products/turbines/advanced/tornado.html</a></p>', '<p>The most powerful air driven handpiece of the world<br /><br />Power is Control. The confidence to master any challenge. Every aspect of the Tornado makes a clear and con