(29, 1, 1, '<section class="col leftside">\r\n<article class="innertextblock">\r\n<ul>\r\n<li>Fully automatic</li>\r\n<li>Delivery twice as fast as with the previous MixStar model</li>\r\n<li>3 selectable speeds</li>\r\n<li>2 timers for working and setting times</li>\r\n<li>Easy to use and quick processing</li>\r\n<li>Suitable for foil bags and cartridges</li>\r\n</ul>\r\n<h3>Fully automatic mixing with electronic perfection.</h3>\r\n<p>Mixing has never been easier, faster and so safe: With MixStar-eMotion, DMG presents the latest generation of fully automated impression material mixing.<br /><br />Using the high-tech device is child’s play. The MixStar-eMotion can be controlled with only one hand by means of a quick push-button operation – incorrect dosages are impossible. And its stylish design also impresses visually in the practice.</p>\r\n<h3>Versatility included.</h3>\r\n<p>Regardless of your impression material and technique preferences: the MixStar-eMotion truly makes your daily work easier. For fully-automated use, there is an extensive range of high-quality DMG impression materials to choose from. The device is also compatible with conventional pre-filled cartridges and foil bags.</p>\r\n<p>More Info: <a href="https://www.dmg-dental.com/en/products/product/mixstar-emotion-2/" target="_blank">https://www.dmg-dental.com/en/products/product/mixstar-emotion-2/</a></p>\r\n</article>\r\n</section>', '<p>Fully automatic mixing with electronic perfection.</p>', 'mixstar-emotion', '', '', '', 'MixStar-eMotion', '', ''),
