(30, 1, 1, '<p>LuxaCore Z DMG’s premium composite for core build-ups and post cementation provides dentine-like cuttability, which ensures controlled substance removal and a precise preparation margin. LuxaCore Z gives you optimal guidance control of the bur. At the transitions between dentine and LuxaCore Z you will not notice any difference. This tactile stability permits groove-free preparations without any undercuts, presenting ideal conditions for the dental technician to perform precise work.</p>\r\n<p>The result: excellent fit, a long-lasting restoration and the best possible care for your patient.</p>\r\n<p>The right partners allow quality care to be provided perfectly: The LuxaPost composite post and the LuxaBond-Total Etch adhesive system give the dentist the best possible assistance.</p>\r\n<p>More info: https://www.dmg-dental.com/en/products/product/luxacore-z/</p>', '<p>Genuine dentine feeling for precise preparation</p>\r\n<p>LuxaCore Z DMG’s premium composite for core build-ups and post cementation provides dentine-like cuttability, which ensures controlled substance removal and a precise preparation margin. </p>', 'luxacore-z', '', '', '', 'LuxaCore Z', '', ''),
