(31, 1, 1, '<p>Pre-silanized and radiopaque</p>\r\n<p>To meet the needs of your practice in full, the new generation of LuxaPost is radiopaque and already pre-silanized. </p>\r\n<p>This simplifies the handling and reduces the treatment cost. Additional silane is no longer needed.</p>\r\n<p>For all dentists who don’t want to do without the extra silanization step, DMG still offers the DMG silane system as a reliable two-bottle system.</p>\r\n<p>More info: https://www.dmg-dental.com/en/products/product/luxapost/</p>', '<p>As with LuxaCore Z, the properties of the material in LuxaPost are also based on the model of a natural tooth.</p>\r\n<p>LuxaPost‘s low flexural modulus (a measure of the elasticity or stiffness) corresponds closely to that of natural dentine. </p>\r\n<p>This minimizes peak stresses in the post-cement-root system and lowers the risk of root fractures.</p>\r\n<p>The high degree of transparency prevents the post from shining through the tooth. It is therefore no barrier to esthetic restorations.</p>', 'luxapost', '', '', '', 'LuxaPost', '', ''),
(31, 1, 3, '', '', '', '', '', '', '', '', ''),
