(32, 1, 1, '<p><strong>Plus Points for your Veneer Work</strong></p>\r\n<p>The high-quality materials in the Vitique product system offer you numerous practical benefits. Superior color stability, for example, ensures esthetic restorations that also last long-term. Further critical plus points:</p>\r\n<p><strong>The new Vitique:</strong> </p>\r\n<p>The new Vitique is a premium, resin-based luting material, developed especially for exacting veneering work.</p>\r\n<p>It is an exceptional material for placement of thin-layered, silica-based ceramic and composite restorations.</p>\r\n<p>That''s not all Vitique has to offer.</p>\r\n<p>More Info: https://www.dmg-dental.com/en/products/product/vitique-1/</p>', '<p>Superior materials provide a complete system for veneer cementation<br />Outstanding shade reproduction and shade selection<br />Exact shade match between try-in and cement<br />Particularly easy clean-up<br />High color stability<br />Comprehensively illustrated user guide included<br />Additional utilization support and practical services, such as video tutorials, photo course and expert hotline</p>', '-vitique-veneer-cementation-with-added-value', '', '', '', 'Vitique - Veneer cementation with added value', '', ''),
