(36, 6, 1, '<p><strong>Flexible range of applications</strong></p>\r\n<p>LuxaBond-Total Etch is the final component in DMG‘s product range for post-endodontic restorations. The adhesive system is also suitable for fixing inlays. Self-curing does more than just allow it to be used in areas that the light does not reach. </p>\r\n<p>Even the unwanted premature curing of pools on the floor of the cavity (the »pooling effect«) can be avoided, as the curing can also be done entirely after insertion of the post. LuxaBond-Total Etch can generally be used with LuxaCoreZ-Dual for core build-up or for adhesive cementation of crowns and bridges with Vitique or PermaCem. In these cases, there is the option of curing it with light.</p>\r\n<p>More Info: https://www.dmg-dental.com/en/products/product/luxabond-total-etch-1/</p>', '<p><strong>Dual-curing adhesive system</strong></p>\r\n<p>Self-curing: Hardens even without light</p>\r\n<p>No premature polymerization of bonding »pools«</p>\r\n<p>Compatible with self-curing and dual-curing materials:</p>\r\n<p>Suitable for all applications with LuxaCore</p>\r\n<p>Pre-Bond facilitates quicker curing of the bond mix in the dentine for superior retention</p>\r\n<p>Easy root canal application with special Endobrushes</p>\r\n<p>Does not contain acetone</p>', 'luxabond-total-etch', '', '', '', 'LuxaBond-Total Etch', '', ''),
