(37, 1, 1, '<p><strong>One-push bonding.</strong></p>\r\n<p>TECO is the innovative total-etch bonding system from DMG. Besides its excellent bond strength properties, TECO (= Total Etch Control) stands out thanks to its unique DMG patented single dose application form: the »SilvR dose«. The material is freshly activated by simply pressing on the silver chamber and can be used immediately. Application is carried out in just one step – with one hand, quickly and cleanly.</p>\r\n<p>The fact that the user-friendly application does not compromise safety is proven by an independent American study. With its excellent bond strength of 38 MPa*, TECO outclasses the competition.</p>\r\n<p>Additional assurance is provided by the exceptionally user-friendly Total-Etch technique. It enables you to work on moist surfaces after etching, thus preventing over-drying of the dentine.</p>\r\n<p>With TECO in the »SilvR dose« you have always everything under control. See for yourself how progressive bonding can be.</p>\r\n<p>More Info: https://www.dmg-dental.com/en/products/product/teco/</p>\r\n<p> </p>', '<p>Innovative single dose application form »SilvR dose«</p>\r\n<p>Easy, one-hand »push button« application</p>\r\n<p>Hygienic handling</p>\r\n<p>Secure application with constant quality</p>\r\n<p>Convenient distribution within the dental practice</p>\r\n<p>Superior bonding properties (38 MPa)</p>\r\n<p>Exhibits antibacterial activities</p>', 'teco', '', '', '', 'TECO', '', ''),
(37, 1, 3, '', '', '', '', '', '', '', '', ''),
(37, 2, 1, '<p><strong>One-push bonding.</strong></p>\r\n<p>TECO is the innovative total-etch bonding system from DMG. Besides its excellent bond strength properties, TECO (= Total Etch Control) stands out thanks to its unique DMG patented single dose application form: the »SilvR dose«. The material is freshly activated by simply pressing on the silver chamber and can be used immediately. Application is carried out in just one step – with one hand, quickly and cleanly.</p>\r\n<p>The fact that the user-friendly application does not compromise safety is proven by an independent American study. With its excellent bond strength of 38 MPa*, TECO outclasses the competition.</p>\r\n<p>Additional assurance is provided by the exceptionally user-friendly Total-Etch technique. It enables you to work on moist surfaces after etching, thus preventing over-drying of the dentine.</p>\r\n<p>With TECO in the »SilvR dose« you have always everything under control. See for yourself how progressive bonding can be.</p>\r\n<p>More Info: https://www.dmg-dental.com/en/products/product/teco/</p>\r\n<p> </p>', '<p>Innovative single dose application form »SilvR dose«</p>\r\n<p>Easy, one-hand »push button« application</p>\r\n<p>Hygienic handling</p>\r\n<p>Secure application with constant quality</p>\r\n<p>Convenient distribution within the dental practice</p>\r\n<p>Superior bonding properties (38 MPa)</p>\r\n<p>Exhibits antibacterial activities</p>', 'teco', '', '', '', 'TECO', '', ''),
